/**
 * @param {number[]} arr
 * @return {number}
 */



const debug = true;

var minJumps = function (arr) {
    const pos = new Map();

    for (let i = 0; i < arr.length; i++) {
        if (!pos.has(arr[i])) {
            pos.set(arr[i], []);
        }
        pos.get(arr[i]).unshift(i)
    }

    debug && console.log({ pos })

    let q = [0];

    const visited = Math.pow(10, 9);

    let cnt = 0;

    while (true) {
        debug && console.log({ cnt, q, arr });

        const qn = [];

        for (const cur of q) {
            // debug && console.log({ cur });

            if (cur == arr.length - 1) {
                return cnt;
            }

            const prev = arr[cur];
            arr[cur] = visited;

            if (cur < arr.length - 1 && arr[cur + 1] != visited) {
                if (cur + 1 == arr.length - 1) {
                    return cnt + 1;
                }
                if (qn.indexOf(cur + 1) == -1) {
                    qn.push(cur + 1);
                }
            }

            if (cur > 0 && arr[cur - 1] != visited) {
                if (cur - 1 == arr.length - 1) {
                    return cnt + 1;
                }

                if (qn.indexOf(cur - 1) == -1) {
                    qn.push(cur - 1);
                }
            }

            const jumpable = pos.get(prev);
            if (jumpable === undefined) continue;
            for (const j of jumpable) {
                // debug && console.log("jumpable ", j)
                // if (j == arr.length - 1) {
                //     return cnt;
                // }
                if (j == cur) continue;
                if (arr[j] == visited) continue;
                if (qn.indexOf(j) == -1) {
                    qn.push(j);
                }
            }
        }

        cnt++;
        q = qn;
    }
}

